import { createRouter, createWebHistory } from 'vue-router';
import TransportCompanyTable from './components/TransportCompanyTable.vue';
import BalanceInquiry from './components/BalanceInquiry.vue';

const routes = [
  {
    path: '/TransportCompanyTable',
    name: 'TransportCompanyTable',
    component: TransportCompanyTable,
  },
  {
    path: '/BalanceInquiry',
    name: 'BalanceInquiry',
    component: BalanceInquiry,
  },
]

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
